import Head from "./header";
import { BrowserRouter as Router, Link } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import Image1 from "./img/blogging-336376_1920.jpg";
import "./developer.css";
import Footer from "./footer";

function Developer() {
  // const jobs = () => [
  //     {}
  // ]
  return (
    <div>
      <Head />
      <div>
        <div className="about-banner">
          {/* <div>ABOUT US</div>
                <div><span>Home</span><span>About Us</span></div> */}
          <div>
            <hr style={{ marginTop: "0em" }} />
            <div className="aboutus">WE ARE HIRING</div>
            <div className="home-aboutus">
              <span>HOME</span>
              <i className="fa fa-angle-right" style={{marginLeft:"0.3em",marginRight:"0.3em", fontSize:"1.3em"}}></i>
              <span>WE ARE HIRING</span>
            </div>
          </div>
        </div>


        </div>
      <Footer/>
    </div>
  );
}

export default Developer;
